                                                                            "            if (params.size == 0) then {return name}",
                                                                            "            var underScores := \"\"",
                                                                            "            params.do { _ -> underScores := underScores ++ \"_\" }",
                                                                            "                separatedBy { underScores := underScores ++ \",\" }",
                                                                            "            name ++ \"(\" ++ underScores ++ \")\"",
                                                                            "        }",
