                                                                            "            repeat (depth-1) times {",
                                                                            "                s := s ++ \"  \"",
                                                                            "            }",
                                                                            "            def pb = if (isPreceededByBlankLine) then { \" > blank\" } else { \"\" }",
                                                                            "            \"{s}Comment{pb}({line}{endLine}): {value}\"",
                                                                            "        }",
                                                                            "        method toGrace(depth) {",
