                                                                            "        method shallowCopyFieldsFrom(other) {",
                                                                            "            super.shallowCopyFieldsFrom(other)",
                                                                            "            value := other.value",
                                                                            "            isPartialLine := other.isPartialLine",
                                                                            "            endLine := other.endLine",
                                                                            "            self",
                                                                            "        }",
                                                                            "    }",
